CREATE DEFINER=`root`@`localhost` PROCEDURE `spclibon`(clientes INT)
BEGIN
	SELECT a.idcli, b.nombre 
    FROM tbfacmae20 a, tbcli03 b 
    WHERE fecha >= CURDATE() - INTERVAL 1 MONTH AND a.idcli=b.idcli 
    GROUP BY (idcli) 
    ORDER BY (idcli) ASC LIMIT clientes;
END ;;
