CREATE DEFINER=`root`@`localhost` PROCEDURE `spcomp`(ini DATE, fin DATE)
BEGIN
	SELECT a.norecep, b.nombre, c.nombre, a.fecha, a.condicion, a.monto, a.balance
	FROM tbrecmae18 a, tbsup09 b, tbsuc26 c
	WHERE a.idsup=b.idsup AND a.idsuc=c.idsuc AND fecha BETWEEN ini AND fin;
END ;;
